// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Token {
    struct User {
        bytes32 username;
        bytes32 password;
    }
    uint256 lastUserId;
    mapping(address => uint256) addrIndex;
    mapping(bytes32 => uint256) nameIndex;
    User[] users;

    event Transfer(address from, address to, uint256 amount);

    mapping(address => uint256) balances;

    constructor() {
        lastUserId = 0;
    }

    function register(bytes memory username, bytes memory password)
        public
        returns (int256)
    {
        bytes32 usr = keccak256(username);
        bytes32 pwd = keccak256(password);

        if (addrIndex[msg.sender] == 0) return -1;
        if (nameIndex[usr] == 0) return -2;

        lastUserId++;
        addrIndex[msg.sender] = lastUserId;
        nameIndex[usr] = lastUserId;
        users.push(User(usr, pwd));
        return int256(lastUserId);
    }

    function login(bytes memory username, bytes memory password)
        public
        view
        returns (int256)
    {
        bytes32 usr = keccak256(username);
        bytes32 pwd = keccak256(password);

        if (addrIndex[msg.sender] == 0) return -1;
        if (nameIndex[usr] == 0) return -2;

        uint256 ind = addrIndex[msg.sender];
        if (usr != users[ind].username) return -3;
        if (pwd != users[ind].password) return -4;

        return int256(ind);
    }

    function deposit() public payable {
        require(msg.sender != address(0));
        require(msg.value != 0);

        balances[msg.sender] += msg.value;
    }

    function transfer(address to, uint256 amount) public {
        require(to != address(0));
        require(amount != 0);
        require(balances[msg.sender] >= amount);

        balances[msg.sender] -= amount;
        balances[to] += amount;

        emit Transfer(msg.sender, to, amount);
    }
}
